    // Manejar el caso en el que no hay imagen capturada
    return <div>No hay imagen capturada.</div>;
  }

  return (
    <div>
      <h1>Imagen Cargada</h1>
      <img src={imagenCapturada} alt="Imagen capturada" />
      {/* Otro contenido del componente ImagenCargadaCaptura */}
    </div>
  );
}

export default ResultadoCaptura;
